//Add to funnel
$('.add-funnel').live('click', function(e) {
    var button = $(this),
        text = button.find('.text-add-funnel'),
        product_id = button.closest('[data-product-id]').data('product-id');

    if(button.hasClass('added')) return;

    text.text('Remove');
    button.addClass('added');
    button.removeClass('button-primary');
    button.addClass('button-secondary');
    $('.icon-add').addClass('icon-remove');
    $('.icon-remove').addClass('icon-add');

    $.ajax({
        url: '/funnel/add/' + product_id,
        type: 'POST',
        dataType: 'json',
        success: function(json) {
            $('.funnel-count').text(json.count);
        }
    });
});

//Remove from funnel
$('.add-funnel.added').live('click', function(e) {
    var button = $(this),
        text = button.find('.text-add-funnel'),
        product_id = button.closest('[data-product-id]').data('product-id');

    text.text('Add to Funnel');
    button.removeClass('added');
    button.addClass('button-primary');
    button.removeClass('button-secondary');
    $('icon-remove').addClass('icon-add');
    $('.icon-add').addClass('icon-remove');

    $.ajax({
        url: '/funnel/remove/' + product_id,
        type: 'POST',
        dataType: 'json',
        success: function(json) {
            $('.funnel-count').text(json.count);
        }
    });
});
